import Head from 'next/head'

function Header(){
    return(
        <div>
            <Head>
                <title>食肉汉尼拔</title>
                <meta charSet='utf-8'/>
            </Head>
            <div>Hannibalu.com</div>
        </div>
    )
}

export default Header
